import { Link, BrowserRouter, Route } from "react-router-dom";

import QuoteList from "./components/quotes/QuoteList";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact>
          <QuoteList />
        </Route>
        <Route path="/all-quotes">All Quotes</Route>
        <Route path="/add-a-quote">Add a Quote</Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
